			},
			
			"on_triggered": "if( not level.player.get_stored_event('started_initial_prospera_conversation'), fire_event(me,'conversation_part1'),
								if( level.player.get_stored_event('finished_initial_prospera_conversation'), remove_object(me))
							)",

			"on_conversation_part1": "[
				level.player.store_event('started_initial_prospera_conversation', 1),
				
				speech_dialog(
					prospera,	[~What's this, now?~],
					frogatto,	[~What's what?~],
					prospera,	[~You.~],
								[~You'll pardon my being brusque, but\\nI have no idea who you are.~],
								[~And it tends to happen that complete\\nstrangers are usually up to no good.~],
								[~Care to explain yourself?~,
									~I'm the delivery guy.~, [speech_dialog(
										frogatto,	[~I'm the delivery guy.\\nI brought food.~],
										prospera,	[~I didn't order a pizza.~],
										frogatto,	[~But you did order ... a watercrust?~],
										prospera,	[~What gave you that idea?~],
										frogatto,	[~A fellow named Imoti gave it to me.~],
													[~He was going to deliver it to you but\\nI guess uh... he said it'd be a good excuse to meet.~],
										prospera,	[~Which is a fancy way of saying he\\nwas just too lazy to do it.~],
										frogatto,	[~Are you going to eat it?~],
										prospera,	[~Well, yes.\\nWhat <em>else</em> would I do with it?~],
										frogatto,	[~Beats me.  I just figured you were going\\nto do some kind of witch stuff with it.~],
													[~Bubbling cauldron and all that.~],
										prospera,	[~What on earth?\\n... no it's just food.~],
													[~I'm just going to eat it.  It's a quick meal.~],
													fire_event(me,'conversation_part3'),
									)],
									~Why should I?~,	[speech_dialog(
										frogatto,	[~Why should I?\\nI have every right to be here.~],
										prospera,	[~No, you don't.  Not at all.\\nThis is <em>my</em> house.~],
													[~You're on private property and\\nyou're being pretty shifty.~],
													[~Explain yourself, now, or I'll give you\\nthe surprise of a lifetime.~],
										frogatto,	[~...~],
													[~Sure!\\nI love surprises.~],
										prospera,	[~Okay.~],
													[~(imagine a magic spell gets\\ncast here and hits frogatto)~],
													fire_event(me,'conversation_part2'),
									)],
								],
				),
			
			] 	where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
					where frogatto = (obj frogatto_playable <- level.player)",

			"on_conversation_part2": "[
							speech_dialog(
				frogatto,	[~Whoa... what was <em>that</em> all about?~],
							[~What just happened?~],
				prospera,	[~Magic.~],
							[~So tell me, how do you feel?~],
				frogatto,	[~Vaguely existential?~],
				prospera,	[~Look at your hands!~],
				frogatto,	[~Uhm... okay.~],
							[~They're calloused and careworn?~],
				prospera,	[~No, <em>LOOK AT THEM!</em>\\nLook at yourself!~],
				frogatto,	[~Look, I'm really confused.\\nWhat's obvious here that I'm not seeing?~],
				prospera,	[~You're a frog.~],
				frogatto,	[~Yes?~],
							[~I mean, I guess I've really never been\\n<em>mindful</em> of that, particularly...~],
							[~But that's actually kinda...\\n deep, in a philosophical way.~],
							[~This is pretty intense.~],
				prospera,	[~<em>I turned you into a frog.</em>\\nClue into that already!~],
							[~See, if you ask nicely, I might turn you back.~],
				frogatto,	[~I'm not sure this worked out\\nthe way you seem to think...~],
				prospera,	[~Which part?\\nI mean, you're a frog.~],
				frogatto,	[~Yeah, but I've <em>always</em> been a frog.~],
				prospera,	[~... wait.  What?!~],
							[~You were already a frog <em>BEFORE</em> I did that?!?~],
				frogatto,	[~I'm afraid so.~],
				prospera,	[~Gosh.\\nI'm at a loss for words.~],
							[~...~,~I'm going to be perfectly honest...~],
							[~This has never happened.\\nI've never turned something <em>into itself.</em>~],
							[~In fact I actually don't even know\\nwhat's <em>supposed</em> to happen.~],
							[~Do you feel unusually froggy?\\nLike ... more 'yourself' than usual?~],
							[~Maybe ... <em>twice</em> the frog you used to be?~],
				frogatto,	[~uhh...~],
				prospera,	[~I think you'll be fine, if you feel normal.\\nI guess?~],
				frogatto,	[~I hope so.~],
				prospera,	[~So I feel like we might have\\ngotten off on the wrong foot.~],
							[~My name's Prospera.~],
							[~I live here, I'm a witch.\\nI've fallen into the job of protecting the village.~],
							[~It's a long story.~],
				),
			
				fire_event(me,'conversation_part3'),
			] 	where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
					where frogatto = (obj frogatto_playable <- level.player)",

			"on_conversation_part3": "[
							speech_dialog(
				prospera,	[~So, I have to ask...\\nWhat are you here, for, really?~],
				frogatto,	[~Well, to make a long story short,\\nI'm trying to go east, and there are these\\nblue force fields in the way.~],
							[~Imoti told me you knew how to take them down.~],
							[~Would you be willing to do that?~],
				prospera,	[~Yeah, I'm really not comfortable doing that.\\nThey're there for a very good reason.~],
							[~Firstly, it's to protect the town from\\nsomething pretty nasty, to the east.~],
							[~Secondly, uh ... it's to protect hapless\\ntourists like yourself from having a\\nunpleasant, and quite permanent detour.~],
							[~I wouldn't go over there unless you\\n<em>really</em> know what you're doing.~],
				frogatto,	[~Well, supposing I do -\\nwhat could we work out?~],
							[~I'd really like to head in that direction...\\nis there anything you could help me out with,\\nassuming I helped you out first?~],
				prospera,	[~Maybe.~],
				),
			
				remove_object(me)
				
			] 	where prospera = (obj prospera_npc <- get_object_or_die(level, 'prospera'))
					where frogatto = (obj frogatto_playable <- level.player)",


			
